import React from 'react'; 
import Navbar from './components/Navbar.js';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './index.css'

function App() {
  return (
    <div className = "App">
      <Router>
        <Navbar/>
        <Routes>
          <Route path="/" exact />
          <Route path="/byGenre" exact />
          <Route path="/byArtist" exact />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
